var indecies=[];
function plotCSV(){
    for(var l = 0;l<csvPoints.length;l++){
        csvPoints[l].setMap(null);
    }
    csvPoints=[];
    document.getElementById('textPlotCover').style.visibility='hidden';

    customPlotValue = document.getElementById('textToPlot').value;

    document.getElementById('textToPlot').value = '';
    if(customPlotValue[customPlotValue.length-1] == '\n'){
        customPlotValue = customPlotValue.substr(0,customPlotValue.length-1);
    }
    var customPlotLineArray = customPlotValue.split('\n');
    var headerArray = customPlotLineArray[0].split('\t');
    indecies=[];
    indecies.push(headerArray.indexOf("latitude"));
    indecies.push(headerArray.indexOf("longitude"));
    indecies.push(headerArray.indexOf("color"));
    indecies.push(headerArray.indexOf("date"));
    indecies.push(headerArray.indexOf("dimension"));
    indecies.push(headerArray.indexOf("info"));
    if(indecies[0]==-1||indecies[1]==-1) {
        alert('Cannot find the column for "latitude" or "longitude". Make sure you\'ve labeled the first fow correctly');
    }
    else{
        var colorTypeIndex;
        var values=[];
        var customPlotValueArray = [];
        if (indecies[2]>indecies[3]&&indecies[2]>indecies[4]){
            colorTypeIndex = 2;
        }
        else if (indecies[3]>indecies[2]&&indecies[3]>indecies[4]){
            colorTypeIndex = 3;
        }
        else if (indecies[4]>indecies[2]&&indecies[4]>indecies[3]){
            colorTypeIndex = 4;
        }
        if (colorTypeIndex==3){
            for(var j=1;j<customPlotLineArray.length;j++) {
                customPlotValueArray = customPlotLineArray[j].split('\t');
                var unixDate = Date.parse(customPlotValueArray[indecies[colorTypeIndex]]);
                values.push(unixDate);
            }
            for(var k=1;k<customPlotLineArray.length;k++) {
                var thisColor = colorLookup('dimension',[values,values[k-1]]);
                customPlotValueArray = customPlotLineArray[k].split('\t');
                csvPoints.push(createCSVPoint(customPlotValueArray[indecies[0]], customPlotValueArray[indecies[1]], thisColor, customPlotValueArray[indecies[5]]));
            }
        }
        else if (colorTypeIndex==4){
            for(var m=1;m<customPlotLineArray.length;m++) {
                customPlotValueArray = customPlotLineArray[m].split('\t');
                values.push(customPlotValueArray[indecies[colorTypeIndex]]);
            }
            for(var n=1;n<customPlotLineArray.length;n++) {
                var thatColor = colorLookup('dimension',[values,values[n-1]]);
                customPlotValueArray = customPlotLineArray[n].split('\t');
                csvPoints.push(createCSVPoint(customPlotValueArray[indecies[0]], customPlotValueArray[indecies[1]], thatColor, customPlotValueArray[indecies[5]]));
            }
        }
        else{
            for(var i=1;i<customPlotLineArray.length;i++) {
                customPlotValueArray = customPlotLineArray[i].split('\t');
                csvPoints.push(createCSVPoint(customPlotValueArray[indecies[0]], customPlotValueArray[indecies[1]], customPlotValueArray[indecies[colorTypeIndex]], customPlotValueArray[indecies[5]]));
            }
        }
    }
}
function createCSVPoint(lat,lon,color,info){
    //alert(color);
    var icon = {
        path: 'M-4,0a4,4 0 1,0 8,0a4,4 0 1,0 -8,0',
        fillColor: color,
        fillOpacity: 0.8,
        scale: 1.5,
        strokeColor: '#ffffff',
        strokeWeight: 1
    };
    var pos = {lat: parseFloat(lat), lng: parseFloat(lon)};
    return new google.maps.Marker({
        position: pos,
        icon:icon,
        title:info,
        map: map
    });
}